// src/app/components/add-trip/add-trip.component.ts
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { TripService } from 'src/app/services/trip.service';
import { Trip } from 'src/app/models/trip.model';

@Component({
  selector: 'app-add-trip',
  templateUrl: './add-trip.component.html',
  styleUrls: ['./add-trip.component.css']
})
export class AddTripComponent implements OnInit {
  trip: Trip = {
    tripName: '',
    destination: '',
    startDate: '',
    endDate: '',
    budget: 0,
    transportation: '',
    notes: ''
  };

  isEditMode = false;
  tripId!: number;

  constructor(
    private tripService: TripService,
    private route: ActivatedRoute,
    private router: Router
  ) {}

  ngOnInit(): void {
    const idParam = this.route.snapshot.paramMap.get('id');
    if (idParam) {
      this.tripId = +idParam;
      this.isEditMode = true;
      this.tripService.getTripById(this.tripId).subscribe(data => {
        this.trip = data;
      });
    }
  }

  onSubmit(): void {
  const email = localStorage.getItem('email');  // Get from localStorage

  if (email) {
    this.trip.userEmail = email;  // Add to trip object
  }

  if (this.isEditMode) {
    this.tripService.updateTrip(this.tripId, this.trip).subscribe(() => {
      this.router.navigate(['/trip-list']);
    });
  } else {
    this.tripService.addTrip(this.trip).subscribe(() => {
      this.router.navigate(['/trip-list']);
    });
  }
}

}
<app-user-navbar></app-user-navbar>

<div class="container mt-5">
  <div class="card shadow-lg p-4 rounded animate__animated animate__fadeIn">
    <h2 class="mb-4 text-primary">
      <i class="bi bi-map-fill me-2"></i> {{ isEditMode ? 'Edit Trip' : 'Add New Trip' }}
    </h2>

    <form (ngSubmit)="onSubmit()">
      <div class="form-group mb-3">
        <label><i class="bi bi-card-text me-1"></i>Trip Name:</label>
        <input type="text" class="form-control" [(ngModel)]="trip.tripName" name="tripName" required />
      </div>

      <div class="form-group mb-3">
        <label><i class="bi bi-geo-alt-fill me-1"></i>Destination:</label>
        <input type="text" class="form-control" [(ngModel)]="trip.destination" name="destination" required />
      </div>

      <div class="row">
        <div class="col-md-6 mb-3">
          <label><i class="bi bi-calendar-event me-1"></i>Start Date:</label>
          <input type="date" class="form-control" [(ngModel)]="trip.startDate" name="startDate" required />
        </div>

        <div class="col-md-6 mb-3">
          <label><i class="bi bi-calendar-check me-1"></i>End Date:</label>
          <input type="date" class="form-control" [(ngModel)]="trip.endDate" name="endDate" required />
        </div>
      </div>

      <div class="form-group mb-3">
        <label><i class="bi bi-cash-stack me-1"></i>Budget (₹):</label>
        <input type="number" class="form-control" [(ngModel)]="trip.budget" name="budget" />
      </div>

      <div class="form-group mb-3">
        <label><i class="bi bi-truck-front-fill me-1"></i>Transportation Type:</label>
        <select class="form-control" [(ngModel)]="trip.transportation" name="transportation">
          <option value="Flight">Flight</option>
          <option value="Train">Train</option>
          <option value="Bus">Bus</option>
          <option value="Car">Car</option>
        </select>
      </div>

      <div class="form-group mb-4">
        <label><i class="bi bi-journal-text me-1"></i>Notes:</label>
        <textarea class="form-control" [(ngModel)]="trip.notes" name="notes" rows="3" placeholder="Enter up to 20 words..."></textarea>
      </div>

      <button type="submit" class="btn btn-success w-100 py-2 shadow-sm">
        <i class="bi bi-check2-circle me-1"></i>{{ isEditMode ? 'Update Trip' : 'Add Trip' }}
      </button>
    </form>
  </div>
</div>
